import React from 'react';
import Container from 'react-bootstrap/Container';
import Col from 'react-bootstrap/Col';

const Development = () => {
  return (
    <Container className='container'>
        <Col md={6}>
            <h1></h1>
        </Col>
        <Col md={6}>
            <img></img>
        </Col>
    </Container>
  )
}

export default Development
